Defendant Edward T Dielen in court with attorney Louis Edward Epps.  Defendant Edward T Dielen in custody.  Deann L Heard appeared for the State of Wisconsin.    Sentencing proceeded.  Statements by the State, defense and defendant.  Additional statements by:  Ms. Kelly T.  for the State and Ms. Sandra H. for defendant.    The Court imposed the following sentence:  

AS TO COUNT 01:
The Defendant's TOTAL LENGTH OF SENTENCE shall be 12 years.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for 6 years with credit for 88 days time served.  Defendant shall serve  6 years on EXTENDED SUPERVISION.  
 * Provide a DNA sample if one was not previously taken.
AS TO COUNT 02:
The Court imposed the following sentence:   The Defendant's TOTAL LENGTH OF SENTENCE shall be 4 years, concurrent to Count 1.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for  2 years with credit for 88 days time served.  Defendant shall serve 2 years on EXTENDED SUPERVISION. 
 * DNA sample ordered in Count 1.

AS TO COUNT 03:
The Defendant's TOTAL LENGTH OF SENTENCE shall be 4 years concurrent to Counts 1 and 2 to any other sentence.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for 2 years  with credit for 88 days time served.  Defendant shall serve 2  years  on EXTENDED SUPERVISION. 
 * DNA sample ordered in Count 1.

The defendant is eligible for the Challenge Incarceration Program and for the Wisconsin Substance Abuse Program.  The Court advised the defendant of his determinate sentence pursuant to statute and in accordance with Form CR-234.  Copy provided to defendant. 

AS TO COUNTS 1, 2 AND 3:
Pay restitution as follows:  $178.89 to Maas Petroleum Inc.; $1,300.00 to Dale and Cynthia A.; plus the DNA surcharges, costs and disbursements, with restitution to be paid first.  Court ordered monies to be taken by the Department of Corrections from up to 25% of prison funds.  Balance to be paid while on Extended Supervision.

CONDITIONS OF SUPERVISION:
 - No contact with Kelly T., Kimberly S. or Dale or Cynthia A.;
 - No contact with Maas Petro Mart at 5930 West Greenfield Avenue, West Allis, Wisconsin;
 - Undergo a mental health evaluation and follow any treatment regimen prescribed/ordered;
 - No controlled substances other than those legally prescribed for defendant for medication regimen by a duly licensed provider within the state of Wisconsin; take as prescribed and only for as long as deemed medically reasonable and necessary;
 - No alcohol;
- AODA assessment and treatment;
 - Urine screens to ensure compliance;
 - Seek and maintain employment;
 - Be given job and vocational training;
 - Cognitive thinking intervention counseling;
 - Anger management counseling;
 - Pay the balances remaining of the restitution, DNA surcharges, costs and disbursements.  Failure to pay amounts in full would result in a civil judgment entered against defendant.

